import { StyleSheet} from 'react-native';

const homePageStyles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#7B7D7D',
      alignItems: 'center',
      justifyContent: 'center',
    },
    
  });
export {homePageStyles};
